column8:
アッパーは伸縮性のあるストレッチ素材を使用しているので、足幅にお悩みの方にオススメの1足です。<br><br>
また、アーチサポートクッションを使用する事により、足の中滑りを抑え、つま先への負担を軽減しますので、外反母趾に悩んでいる方におすすめです。<br><br> 
ソールは正しい位置で屈曲するフレックス設計です、楽に歩くことが出来ます。<br><br>
また、パンプスタイプですので、オフィス履きにもおすすめです。<br><br>

